[{'badge_info': 'N0026 | 31/01/19', 'titulo': 'REGULAMENTOS DE TRÁFEGO LOCAL', 'texto1': '- Regulamentos de tráfego local modificados.

1) Dias e horários: H24

2) Aeronaves da aviação geral deverão requerer autorização prévia com 24 horas de antecedência ao Centro de Coordenação de Operações (CCO) através do e-mail: cco@floripa-airport.com, independentemente do tempo de permanência. Dúvidas contatar telefones: +55 48 3012-4434, +55 48 3331-4095 ou +55 48 3331-4012.

3) Deverão ser informados no e-mail ao CCO:
a. Matrícula da aeronave;
b. Data da operação;
c. Origem/Destino (IATA/ICAO);
d. Horário de Pouso e decolagem (horário local);
e. PMD/MTOW (em quilogramas);
f. Modelo de aeronave (ICAO e IATA);
g. Proprietário/operador da aeronave com CPF ou CNPJ.', 'texto2': '
  	Período:  De 31 de janeiro de 2019, 0000 UTC até 31 de dezembro de 2019, 2359 UTC.
	Ref: AIP AD 2.20

